import React from 'react';
import Link from 'next/link';
import '../css/bootstrap.css'

const Menu = () => {
  return (
    <div>
      <ul className="nav flex-column">
        <li className="nav-item">
          <Link href='/'>
            <a className="nav-link">Home</a>
          </Link>
        </li>

        <li className="nav-item">
          <Link href='/about'>
            <a className="nav-link">Sobre</a>
          </Link>
        </li>
      </ul>

    </div>
  );
};

export default Menu;
